import React, { Component } from "react";

class Todos extends Component {
  render() {
    return (
      <div
        style={{
          fontWeight: "bold",

          border: "red",
          fontSize: "30px"
        }}
      >
        <ol>
          {this.props.allTodos.map((value, index) => {
            return (
              <div>
                <li>{value}</li> <button>delete</button>
              </div>
            );
          })}
        </ol>
      </div>
    );
  }
}

export default Todos;
